def gcd(a, b):
    if b == 0:
        return a
    else:
        return gcd(b, a % b)

def lcm(a, b):
    return (a * b) // gcd(a, b)

l = lcm(a1 - b1, a2 - b2)

ans = 0

for i in range(l, R + 1):
    if (i - b1) % (a1 - b1) == 0 and (i - b2) % (a2 - b2) == 0 and L <= i <= R:
        ans += 1

